let bottomSectionContainer = document.getElementById("bottom-section");
let homeLink = document.getElementById("homeLink");
let skillsLink = document.getElementById("skillsLink");
let projectLink = document.getElementById("projectsLink");


let home = () => {
    bottomSectionContainer.textContent = "";
    let bgElement = document.createElement("div");
    bgElement.classList.add("home-bg-container");
    bottomSectionContainer.appendChild(bgElement);

    let innerHomePage = document.createElement("div");
    innerHomePage.classList.add("innerHomePage");

    bgElement.appendChild(innerHomePage);

    let cardElementContainer = document.createElement("div");
    cardElementContainer.classList.add("homeCard");
    let cardElement = document.createElement("p");
    cardElement.textContent = "Hello! I am Kagitha Sasidhar,Currently I am pursuring B.Tech in Computer Science at  R.V.R & J.C ENGINEERING COLLEGE. With a keen interest in web development and software development, I aspire to leverage my skills to innovate and contribute to the tech industry.";
    cardElementContainer.appendChild(cardElement);

    innerHomePage.appendChild(cardElementContainer);

    let imageElementContainer = document.createElement("div");
    imageElementContainer.classList.add("homeimageContainer");

    let imageElement = document.createElement("img");
    imageElement.classList.add("homeProfilePhoto");
    imageElement.src = "https://res.cloudinary.com/dxmv32l6y/image/upload/v1722739707/Pi7_Passport_Photo_1_rz38vi.jpg";


    imageElementContainer.appendChild(imageElement);
    innerHomePage.appendChild(imageElementContainer);


};

let skills = () => {
    bottomSectionContainer.textContent = "";

    let skillsBgContainer = document.createElement("div");
    skillsBgContainer.classList.add("skillsBgContainer");
    bottomSectionContainer.appendChild(skillsBgContainer);

    let mainheading = document.createElement("h1");
    mainheading.classList.add("skillsMainheading");
    mainheading.textContent = "My Skills";

    skillsBgContainer.appendChild(mainheading);

    let skillsList = [{
            heading: "Html",
            src: "data:image/png;base64,",
            descriptions: "Used to devolp the structure of webpage."
        },
        {
            heading: "Css",
            src: "data:image/png;base64,",
            descriptions: "Used to style the webpage."
        }, {
            heading: "Js",
            src: "https://cdn2.iconfinder.com/data/icons/designer-skills/128/code-programming-javascript-software-develop-command-language-512.png",
            descriptions: "To develop dynamic webpages."
        },
        {
            heading: "Bootstrap",
            src: "data:image/png;base64,",
            descriptions: "It provides a collection of code snippets."
        }, {
            heading: "Java",
            src: "data:image/png;base64,",
            descriptions: "It is a programming language."
        }, {
            heading: "Python",
            src: "data:image/png;base64,",
            descriptions: "It is a programming language."
        }, {
            heading: "Angular Js",
            src: "data:image/png;base64,",
            descriptions: "It is a framework."
        }, {
            heading: "NodeJs",
            src: "data:image/png;base64,",
            descriptions: "It provides environment for JS."
        }
    ];
    let skillsContainer = document.createElement("div");
    for (let skillObjInd in skillsList) {

        skillsContainer.classList.add("skillsContainer");

        let skillsCard = document.createElement("div");
        skillsCard.classList.add("skillsCard");

        let skillImage = document.createElement("img");
        skillImage.src = skillsList[skillObjInd].src;
        skillImage.classList.add("skillImage");
        skillsCard.appendChild(skillImage);

        let skillheading = document.createElement("h1");
        skillheading.classList.add("skillheading");
        skillheading.textContent = skillsList[skillObjInd].heading;
        skillsCard.appendChild(skillheading);

        let skilldescription = document.createElement("p");
        skilldescription.classList.add("skilldescription");
        skilldescription.textContent = skillsList[skillObjInd].descriptions;
        skillsCard.appendChild(skilldescription);

        skillsContainer.appendChild(skillsCard);

    }

    skillsBgContainer.appendChild(skillsContainer);



};

let projects = () => {
    bottomSectionContainer.textContent = "";
    let projectSectionBgContainer = document.createElement("div");
    projectSectionBgContainer.classList.add("projectSectionBgContainer");

    let projectContainer = document.createElement("div");
    projectContainer.classList.add("container");
    projectSectionBgContainer.appendChild(projectContainer);

    let projectContainerDirection = document.createElement("div");
    projectContainerDirection.classList.add("row");
    projectContainer.appendChild(projectContainerDirection);

    let projectSectionTop = document.createElement("div");
    projectSectionTop.classList.add("col-12");
    projectContainerDirection.appendChild(projectSectionTop);

    let projectHeading = document.createElement("h1");
    projectHeading.classList.add("projectHeading");
    projectHeading.textContent = "Portfolio";
    projectSectionTop.appendChild(projectHeading);

    let projectHeading1 = document.createElement("h1");
    projectHeading1.classList.add("projectHeading1");
    projectHeading1.textContent = "Projects I have done";
    projectSectionTop.appendChild(projectHeading1);

    let projects = [{
        image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTOjkg7w_IpNBVPIWOD1N1SCgryXY0Jr18Uluw-z_rWqIzjqRR3J6TGA-yeAU4IeAKUrWE&usqp=CAU",
        name: "CGPA Calculator",
        heading: "web design",
        id: "projectid1",
        desc: "It is used to calculate the cgpa.It is specialy designed for rvr students.",
        href: "#"
    }, {
        image: "https://i.pinimg.com/736x/38/b5/d6/38b5d6251f225b5a6c3346131209ab29.jpg",
        name: "Guess a Number",
        heading: "web design",
        id: "projectid2",
        desc: "It is a Game.If You Guess  the  number then  you got a reward else points reduced.",
        href: "https://guessnumberpro1.ccbp.tech/"
    }];

    let function1 = () => {
        bottomSectionContainer = "";
    };
    let function2 = () => {
        bottomSectionContainer = "";
    };
    for (let index in projects) {
        let projectBottomSection = document.createElement("div");
        projectBottomSection.classList.add("col-11", "col-md-6", );
        projectContainerDirection.appendChild(projectBottomSection);

        let projectCard = document.createElement("div");
        projectCard.classList.add("projectCard", "shadow");

        let projectCardImage = document.createElement("img");
        projectCardImage.src = projects[index].image;
        projectCardImage.classList.add("projectCardImage");
        projectCard.appendChild(projectCardImage);

        let projectCardDesContainer = document.createElement("div");
        projectCardDesContainer.classList.add("projectCardDesContainer");

        let projectCardHeading1 = document.createElement("p");
        projectCardHeading1.classList.add("projectCardHeading1");
        projectCardHeading1.textContent = projects[index].heading;
        projectCardDesContainer.appendChild(projectCardHeading1);


        let projectCardHeading2 = document.createElement("h1");
        projectCardHeading2.classList.add("projectCardHeading2");
        projectCardHeading2.textContent = projects[index].name;
        projectCardDesContainer.appendChild(projectCardHeading2);


        let projectCardDesc = document.createElement("p");
        projectCardDesc.classList.add("projectCardDesc");
        projectCardDesc.textContent = projects[index].desc;
        projectCardDesContainer.appendChild(projectCardDesc);

        let projectAnchor = document.createElement("a");
        projectAnchor.textContent = "Lets Go";
        projectAnchor.id = projects[index].id;
        projectAnchor.href = projects[index].href;
        projectAnchor.classList.add("projectCardanchor");
        projectAnchor.setAttribute("target", "_self");
        projectCardDesContainer.appendChild(projectAnchor);

        projectCard.appendChild(projectCardDesContainer);

        projectBottomSection.appendChild(projectCard);



    }













    bottomSectionContainer.appendChild(projectSectionBgContainer);
};

homeLink.addEventListener("click", home);
skillsLink.addEventListener("click", skills);
projectLink.addEventListener("click", projects);
